import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';

import { UserRouteAccessService } from 'app/core/auth/user-route-access.service';
import { BlackOutDateComponent } from './black-out-date.component';


const blackOutDateRoute: Routes = [
  {
    path: '',
    component: BlackOutDateComponent,
    data: {
      defaultSort: 'id,asc',
    },
    canActivate: [UserRouteAccessService],
  },
];

@NgModule({
  imports: [RouterModule.forChild(blackOutDateRoute)],
  exports: [RouterModule],
})
export class BlackOutDateRoutingModule {}
